	public static List<SZGuoTuGroupBuilding> getSZGuoTuList(Integer goalPage) throws Exception{
		List<SZGuoTuGroupBuilding> resList = new ArrayList<SZGuoTuGroupBuilding>();
		Map<String,String> params = new HashMap<String, String>();
		params.put("__EVENTTARGET", "AspNetPager1");//
		params.put("__EVENTARGUMENT", goalPage+"");//
		params.put("__VIEWSTATE", "");
		params.put("__VIEWSTATEGENERATOR", "248CD702");
		params.put("__VIEWSTATEENCRYPTED", "");
		params.put("__EVENTVALIDATION", "0ul7A9/yH4hEvMgKmEcgpruWC25DcLZ8ab1HwlftHN5NjPOG8eB2Ucido6x82pnEUrj+B3Qr8jda+8kiIyw5tBAHmd84c6qQllHF4iQzh5a/qRHGNJdUOxZVDsBy3GNO5b2oJkcfWjE//ceVfPW0pIcRy5WK9l3S2eR/8prhmDuarH3M");
		params.put("tep_name", "");
		params.put("organ_name", "");
		params.put("site_address", "");
		params.put("AspNetPager1_input", goalPage+"");
		params.put("AspNetPager1", "go");
		Document doc = Jsoup.connect("http://ris.szpl.gov.cn/bol/").data(params).post();
		Element dataList1= doc.getElementById("DataList1");
//		System.out.println(dataList1.text());
		Elements rowList = dataList1.select("tr[bgcolor=\"#F5F9FC\"]");
		//bgcolor="#F5F9FC"
//		System.out.println(rowList.html());
		for(Element currRow:rowList){
			Elements signalColums = currRow.children();
			SZGuoTuGroupBuilding tmpGroupBuilding = new SZGuoTuGroupBuilding();
			 String seqId = signalColums.get(0).text();/**序号*/
			 String preSellNo = signalColums.get(1).text();/**预售证号*/
			 String name = signalColums.get(2).text();/**项目名称*/
			 String enterpriseName = signalColums.get(3).text();/**开发企业*/
			 String blockName = signalColums.get(4).text();/**所在区*/
			 String allowTime = signalColums.get(5).text();/**批准时间*/
			 tmpGroupBuilding.setAllowTime(allowTime);
			 tmpGroupBuilding.setBlockName(blockName);
			 tmpGroupBuilding.setEnterpriseName(enterpriseName);
			 tmpGroupBuilding.setName(name);
			 tmpGroupBuilding.setPreSellNo(preSellNo);
			 tmpGroupBuilding.setSeqId(seqId);
			 System.out.println(JSON.toJSONString(tmpGroupBuilding));
			 resList.add(tmpGroupBuilding);
		}
		return resList;
	}
	
